Knowledge_in:
Assemble and analyze data to understand customer behavior of existing 407 ETR data, external data sources and emerging sources to make recommendations on future state of loyalty program and bring awareness of usage behavior; 
Generate dashboards and automate reports that empower teams across the organization to make data-driven decisions;
Break down strategic problems, and analyze data and information to provide insights and recommendations; Assist in identifying new data sources or analytic approaches to current business problems; Develop data solutions to support the business strategy and stakeholder needs; Build and maintain analytical models to identify revenue opportunities;
Think critically about experimental design and advocate for thoughtful experimentation; Challenge assumptions and ways of working; Collaborate with business partners to implement change to business processes and workflows
